import React from "react";
import Sidebar from "./Sidebar";
import Header from "./Header";

const layoutStyle = {
  display: "flex",
  minHeight: "100vh"
};

const contentStyle = {
  flex: 1,
  padding: "16px"
};

function Layout({ children }) {
  return (
    <div style={layoutStyle}>
      <Sidebar />
      <div style={contentStyle}>
        <Header />
        {children}
      </div>
    </div>
  );
}

export default Layout;
